import React, { Component } from 'react';
import styled from 'styled-components';
import {
  Heading,
  Flex
} from 'rebass/styled-components'

const Page = styled.div`
  background: black;
  height: 100%;
  min-height: 100vh;
`;

class Demo extends Component {

  render() {
    return (
      <Page className="sweetmenu__page">
        <Flex
          flexDirection="column"
          alignItems="center"
          justifyContent="flex-start"
        >
          <Heading
            fontSize={[ 4, 5, 6 ]}
            color='primary'
            fontFamily="inherit"
            className="sweetmenu__form--title">
            Seeing is believing
          </Heading>
        </Flex>
      </Page>
    );
  }

}

export default Demo;
